void f(char const*); void g()
{ char arr[113]; f(arr);
} Компилируется в: g(): sub rsp, 136 mov rdi, rsp call f(char const*) add rsp, 136 ret К локальным переменным обращаемся через rsp, лежат на стеке. Размер стека - переменная на уровне операционной системы (вроде). Обратим внимание на то, что если изменить размер массива на 112 , то этот код скомпилируется в: g(): sub rsp, 120 mov rdi, rsp call f(char const*) add rsp, 120 ret Почему 136 изменилось на 120? Этот эффект называется выравниванием (alignment). В качестве основной единицы работы с памятью используется машинное слово , размер которого обычно составляет несколько байт. Так называемый "unaligned access" сложен в реализации на аппаратном уровне, поэтому обращения по произвольному адресу либо не поддерживаются (и вызывают исключение процессора), либо поддерживаются, но работают медленно. Обычно компилятор выравнивает данные по границам машинных слов, в нашем случае 8 + 16 * k.

