Пример адреса: Virtual adress - 0x123456789A Младшие 12 бит виртуального адреса: смещение внутри страницы. Следующие 10 бит - индекс в таблице страниц, старшие 10 бит - индекс в каталоге страниц. typedef uint32_t page_table_element;
typedef uint32_t virtual_address;
struct page_directory
{ uint32_t translate(virtual_address); private: page_table_element data[1024];
}; Альтернативы: Хеш-таблица : плохо взаимодействует с кэшем. Использовалась в PowerPC Это всё было про 32-битную архитектуру . На 64-битной числа так красиво не сходятся. Используют следующее: добавляется ещё один уровень (можно и не один, на самом деле), массивы делают по 512. Пример: процессор может транслировать только 48 бит (соответствует размеру дерева из уровней). Физической памяти - 39 бит. Почему? "Сколько пинов у процессора есть, чтобы обращаться к памяти, столько и бит". Остальные биты в 64-битном адресе заполнены одинаковыми значениями и мы их не используем. В регистре CR3 хранится указатель на каталог страниц для процесса.

