Деление занимает много больше тактов, чем другие арифметические операции, а во время его вычисления весь конвейер стоит. Компиляторы стараются избегать операции деления, если это возможно. Следующий код на C++: unsigned foo(unsigned a) // беззнаковый тип
{ return a / 2;
} Может быть оптимизирован компилятором до mov eax, edi	; Аргумент находится в edi shr eax ; Логический сдвиг вправо, второй аргумент по умолчанию 1 ret Со знаковым аргументом деление скомпилится так: mov eax, edi shr eax, 31 ; Оставляем старший бит (знак) add eax, edi	; Если число отрицательное, то добавляем 1 (чтобы при a=-1 всё работало) sar eax ; Арифметический сдвиг вправо на 1 бит А что будет с unsigned делением на 3? А оно скомпилится вот так: mov eax, edi mov edi, 2863311531	; 0xAAAAAAAB или 2^33/3 imul rax, rdi shr rax, 33 Почему это лучше? Деление дорогое, а константу можем посчитать при компиляции, получая выигрыш в эффективности. Почему это работает? Потому что при арифметике с переполнением деление на константу можно выполнить через умножение: a / 3 = (a * 2^33) / (3 * 2^33) = (a >> 33) * 2863311531
